
    const urlParams = new URLSearchParams(window.location.search);
    const mobileNumber = urlParams.get('mobileNumber');


function printOrderSummary(order) {
    pdfMake.fonts = {
      Roboto: {
        normal: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.68/fonts/Roboto/Roboto-Regular.ttf',
        bold: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.68/fonts/Roboto/Roboto-Medium.ttf',
        italics: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.68/fonts/Roboto/Roboto-Italic.ttf'
      }
    };

    const docDefinition = {
      background: function(currentPage, pageSize) {
        return {
          image: 'data:image/png;base64,', // replace with your base64 image
          width: pageSize.width,
          height: pageSize.height,
          opacity: 0.5,
          alignment: 'center'
        };
      },
      content: [
        { text: "MIT FAST FOODS", style: "nameheader" }, // Add restaurant name
        { text: "Ram Ganga Vihar Phase 2, MDA, Moradabad", style: "subheader" }, // Add restaurant address
        { text: "Contact us at mit@fastfoods.eat.in", style: "subheader" }, // Add restaurant contact information
        { text: "Order Summary", style: "header" },
        { text: "Order Number: #" + order.order_id },
        { text: "Amount: ₹" + order.total_amount },
        { text: "Date & Time: " + order.order_date },
        { text: "Transaction ID: " + order.payment_id },
        { text: "Customer Mobile Number: " + mobileNumber },
        { text: "Table No: " + order.table_number },
        { text: "Instructions: " + order.instructions },
        { text: "Order Items", style: "subheader" },
        {
          table: {
            headerRows: 1,
            body: [
              ["Food Item", "Size", "Price", "Quantity", "Total Cost"]
            ]
            
          },
          layout: 'lightHorizontalLines',
          style: "subheader"
        },
        {
          table: {
            body: [
              ["", ""], // Empty row for spacing
              ["Grand Total:", "₹" + order.total_amount] // Add grand total row
            ]
          },
            layout: 'lightHorizontalLines'
  
        },
        { text: ""},
        { text: "Thank you for ordering with us!", style: "subheader"},
        { text: "MIT FAST FOODS", style: "subheader" },
        { text: "*This is a computer generated document and doesnet need a signature.", style: "subheader"}
      ],
      
      styles: {
        nameheader: {
          fontSize: 22,
          bold: true,
          margin: [0, 0, 0, 10],
          alignment: 'right'
        },

        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 0, 0, 10]
        },
        subheader: {
          fontSize: 14,
          //make all text italic
          italics: true,
          margin: [0, 10, 0, 5],
          alignment: 'right'
        }
      }
    };

    // Add order items to the table
    for (let item of order.items) {
      docDefinition.content[12].table.body.push([item.name, item.size_name, item.icost, item.quantity, item.icost * item.quantity]);
    }


    // Generate the PDF and trigger the download
    pdfMake.createPdf(docDefinition).download(`order_summary_${order.order_id}.pdf`);
  }
